import React from "react";
import Labrator from "../Images/Labrator.jpg";
import Pug from "../Images/Pug.jpg";
import Rot from "../Images/Rot.jpg";
import Beagle from "../Images/Beagle.jpg";
import Germanshepard from "../Images/Germanshepard.jpg";
import Golden from "../Images/Golden.jpg";
import { Button } from "react-bootstrap"; // Import from 'react-bootstrap'

function Ourproducts() {
    const products = [
        { name: "Labrator", price: "12,000" },
        { name: "Pug", price: "14,000" },
        { name: "Rot", price: "15,000" },
        { name: "Beagle", price: "19,000" },
        { name: "German Shepherd", price: "18,000" },
        { name: "Golden Retriever", price: "24,000" },
    ];

    return (
        <div className="row">
            {products.map((product, index) => (
                <div key={index} className="col">
                    <img src={eval(product.name)} alt={product.name} />
                    <Button variant="primary">{`Price: $${product.price}`}</Button>
                </div>
            ))}
        </div>
    );
}

export default Ourproducts;
